<style> 
.button {
background-color: rgb(89, 95, 89);
border: 2px solid rgb(0, 0, 0);
color: rgb(0, 0, 0);
padding: 40px 68px;
text-align: center;
text-decoration: none;
display: inline-block;
font-size: 40px;
margin: 4px 2px;
cursor: pointer;
border-radius: 12px;
transition: transform 0.2s ease-out;
outline: 2px solid white;
}
.button:hover {
transform: scale(1.05);
}
.button:hover, .button:focus {
outline-offset: 0px;
}
</style>
</head>
<body>
